import { BrowserRouter, Routes, Route } from "react-router-dom";
import AnimeHome from './animes/AnimeHome'
import Login from './components/AnimeHome'
import Register from './animes/AnimeHome'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/">
            {/* <Route index element={<Home />} />
            <Route path="login" element={<Login />} /> */}
            <Route path="animes">
              <Route index element ={<AnimeHome />} />
            </Route>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
